import axios from 'axios';
var instance = axios.create({
  baseURL: 'http://localhost:4445/api/'
});
export var postsAPI = {
  list: function list() {
    return instance.get("article/list").then(function (res) {
      return res.data;
    });
  },
  getOne: function getOne(id) {
    return instance.post("article/".concat(id));
  }
};
